import styles from './Slider.modules.css'
import PhotoGym from './photosSlider'

const Slider = () => {
  return (
    <div className={styles}>
      <div className="slider">
        <div className="darkSides"></div>
        <div></div>{PhotoGym[1]}
      </div>
    </div>
  )
}

export default Slider
